import React from 'react'

function Login() {
  return (
    <div className="main-container">
        <h1>Login</h1>
        <h4>id</h4>
        <input type="text" placeholder='enter id'></input>
        <h4>password</h4>
        <input type="password" placeholder='enter password'></input>
    </div>
  )
}

export default Login
